    return (
        <div className="finish-data">
            <div className="data">
                <div className="fist-basket">
                    <div className="tariff">Acrade/mo</div>
                    <div className="total-price">$9/mo</div>
                    <hr />
                </div>
                <div className="second-basket"></div>
            </div>
            <div className="total"></div>
        </div>
    )
}

